import { useState } from "react";
import { Form, Button, Input, Label, FormGroup } from "reactstrap";
import "./register.css";
import { Navigate } from "react-router-dom";
const Register = () => {
  const [check, setCheck] = useState(false);
  const handleSubmit = (evt) => {
    // console.log(evt.target.username.value);
    const user = {
      username: evt.target.username.value,
      password: evt.target.password.value,
      fullName: evt.target.fullname.value,
      phoneNumber: evt.target.phoneNumber.value,
      email: evt.target.email.value,
    };
    fetch("http://localhost:5000/users/add-user", {
      method: "POST",
      body: JSON.stringify(user),
      headers: { "Content-Type": "application/json" },
      credentials: "same-origin",
    })
      .then((reponse) => {
        return reponse.json();
      })
      .then((reponse) => {
        if (reponse.ok) {
          alert("Successfull!!");
          setCheck(true);
        } else {
          alert("This username is available!!");
        }
      })
      .catch((err) => {
        console.log(err);
      });
    evt.preventDefault();
  };
  if (check) {
    return <Navigate to="/login" />;
  }
  return (
    <div id="wapper">
      <h1>SIGN UP</h1>
      <div className="form">
        <Form onSubmit={handleSubmit}>
          <FormGroup>
            <Label for="fullname">Full Name</Label>
            <Input type="text" id="fullname" name="fullname"></Input>
          </FormGroup>
          <FormGroup>
            <Label for="email">Email</Label>
            <Input type="text" id="email" name="email"></Input>
          </FormGroup>
          <FormGroup>
            <Label for="phoneNumber">Phone Number</Label>
            <Input type="text" id="phoneNumber" name="phoneNumber"></Input>
          </FormGroup>
          <FormGroup>
            <Label for="username">UserName</Label>
            <Input type="text" id="username" name="username"></Input>
          </FormGroup>
          <FormGroup>
            <Label for="password">Password</Label>
            <Input type="text" id="password" name="password"></Input>
          </FormGroup>
          <Button type="submit" value="submit" color="primary">
            Create Acount
          </Button>
        </Form>
      </div>
    </div>
  );
};

export default Register;
